	(1,'http://www.villagevoice.com/events/mr-dream-2622368/','Mr. Dream','mr-dream','Happily shambolic punk-rockers  Mr. Dream  stomp hometown boards this week as part of the Northside Festival, that teeming spray of shows happening across Williamsburg and also the exact bar you came into just to read a book in solitude. Their debut,  Trash Hit , earned them opening gigs for M.I.A. and CSS upon its March release, and not surprisingly: It\'s pure, shrewd fun with tight hooks, distorted riffs, and witty lyrics (\"Knuckle Sandwich\" is straight Pixies fare). Good to find what we lost in the garage circa 1992. With White Suns, Sleepies, and Tony Ferrante.',4,'2011-06-14 15:51:16','2011-06-14 15:51:16','http://www.villagevoice.com/events/mr-dream-2622368/','http://vvoice.vo.llnwd.net/e14//6533518.47.jpg','',137,'event_images/2c020f02b4190f78b1fab9f7d85775295c5da3c6_1.jpg',1,1),
