	(53,'http://www.villagevoice.com/events/the-monkees-2622366/','The Monkees','the-monkees','Remember when Davy Jones started crooning \"Girl\" in  The Brady Bunch Movie , then was alarmed when power-ballad guitars kicked in, then shrugged and went full Steve Perry with it? That was awesome. No guarantees that  the Monkees  will acclimate to current musical trends with the same panache when they reunite for their 45th anniversary (though \"Daydream Believer\" would sound excellent under a Nicki Minaj verse). The tour, which kicked off in Liverpool, wends its way to Beacon Theatre tonight; original members Davy Jones, Micky Dolenz, and Peter Tork will all be on hand to sing their frothy \'60s-pop hits, surely as adorably as they did once on their happy-go-lucky TV show. They get older, but nostalgia stays the same age.',4,'2011-06-14 15:51:23','2011-06-14 15:51:23','http://www.villagevoice.com/events/the-monkees-2622366/','http://vvoice.vo.llnwd.net/e14//6533511.47.jpg','',137,'event_images/2f8bb61cc02d0fe1f4d09482cf57bc67e49b4caa_1.jpg',1,0),
