	(162,'http://www.villagevoice.com/events/cory-arcangel-2586154/','Cory Arcangel','cory-arcangel','In a digital age in which we\'re constantly logging in, live streaming, and updating statuses, sometimes we wish we lived in technologically simpler times. Brooklyn-based digital artist  Cory Arcangel , 32, takes us back to when Tetris was invented and Photoshop was a revolutionary idea in his new exhibition  Pro Tools  at the Whitney. You\'ll see a range of works including single-channel video, kinetic sculpture, and prints that are focused on the concept of \"product demonstrations.\" The highlight of the exhibit is Arcangel\'s bowling alley, consisting of large-scale projections of bowling games, from the \'70s to today, that examine the history of video games and of graphic representation in the digital medium. And because Arcangel\'s work always comes with a good dose of humor, he\'s hacked the games to throw only gutter balls.',4,'2011-06-14 15:51:38','2011-06-14 15:51:38','http://www.villagevoice.com/events/cory-arcangel-2586154/','http://vvoice.vo.llnwd.net/e14//6358416.47.jpg','',127,'event_images/1a8c36e0afa64e0dcd5a76478eef129f4249a2fc_2.jpg',1,13),
	(163,'http://www.villagevoice.com/events/the-handsome-family-2623975/','The Handsome Family','the-handsome-family','After two decades as marrieds and almost as long as a band, the Handsome Family are as much either of those things as they are a cottage industry of beautiful despair. Regular chroniclers of the spellbinding mystery that is our weird mortality, Brett and Rennie Sparks are also well known as onstage cut-ups, a trait as alluring as their elliptical story cycles are captivating. Their music\'s traditional Americana underpinnings continue to evolve, too, sharing the audience\'s curiosity about its subjects and characters. With Brooklyn-based singer and songwriter Daniel Wayne.',4,'2011-06-14 15:51:38','2011-06-14 15:51:38','http://www.villagevoice.com/events/the-handsome-family-2623975/','http://vvoice.vo.llnwd.net/e14//6541488.47.jpg','',137,'event_images/c2fed6c07e5da3941b6ddb98793add1d5783ac11_1.jpg',1,0),
