	(208,'http://www.villagevoice.com/events/bang-on-a-can-marathon-2622382/','Bang on a Can Marathon','bang-on-a-can-marathon','A constantly surprising and ridiculously fun acid test of modern, experimental, and inside-out sounds, the  Bang on a Can Marathon  also unofficially kicks off New York\'s annual summer orgy of free music (see: \"Make Music New York\" on Tuesday). At this year\'s marathon, some 150 musicians will perform dozens of works over 13 hours. Where else can you travel the spaceways with the Sun Ra Arkestra; hear the Prism Quartet play Iannis Xenakis; catch up with recent works by intrepid BOAC founders Michael Gordon, Julia Wolfe, and David Lang; see the Bang on a Can All-Stars perform two pieces byand withPhilip Glass; and come together when the Glenn Branca Ensemble brings everything to a screaming, climactic, midnight finale with Branca\'s hour-long The Ascension: The Sequelall in the course of a single ear-bending day?',4,'2011-06-14 15:51:44','2011-06-14 15:51:44','http://www.villagevoice.com/events/bang-on-a-can-marathon-2622382/','http://vvoice.vo.llnwd.net/e14//6533540.47.jpg','',137,'event_images/1a000ca88cc24c5f858eeefa7e8082d80e92b621_1.jpg',1,0),
