	(247,'http://www.villagevoice.com/events/ruvan-wijesooriya-2609916/','Ruvan Wijesooriya','ruvan-wijesooriya','While James Murphy was recording LCD Soundsystems epic third album,  This Is Happening , he decided hed invite good friend photographer  Ruvan Wijesooriya  along mostly to stir things up. Hes comfortable with how I can make things slightly uncomfortable when they are too comfybut also comfortable when things are too uncomfy, Wijesooriya told the music magazine  self-titled  about the experience that undoubtedly got him the black-and-white grainy image of Murphy for the cover of the album. Fanatic, Wijesooriyas latest show, features other shots of his awesome famous friends in comfortable and uncomfortable positions, including Iggy Pop, Mark Ronson, Ellen Page, Aziz Ansari, and the incomparable Anna Wintour.',4,'2011-06-14 15:51:49','2011-06-14 15:51:49','http://www.villagevoice.com/events/ruvan-wijesooriya-2609916/','http://vvoice.vo.llnwd.net/e14//6525416.47.jpg','',127,'event_images/6efe5c124098881c3b66bcd2aabce7e9b54abd16_1.jpg',1,0),
