	(346,'http://www.villagevoice.com/events/jenny-morgan-one-and-the-many-2559185/','Jenny Morgan: One and the Many','jenny-morgan-one-and-the-many','Artist  Jenny Morgan  takes the art of portraits to a level that is humorous, disturbing, and moving all at once. Her 2009 show Abrasions at Like the Spice gallery featured lifelike oil paintings of men and women (many of them nude) but with patches of skin scratched away to reveal blood and bone underneath. Morgan, who worked in Marilyn Minter\'s studio after graduating from SVA, has contributed pieces to  New York  magazine and, recently, a portrait of Julian Assange to  The New York Times Magazine , which brought her a slew of new collectors. Her latest show,  One and the Many , is an array of portraits that aim to capture the spiritual core of her subjectsa job made somewhat easier due to the fact that she knows them all intimately. Said Morgan: \"Working with people from my own life as subject matter allows me to hone in on specifics of their character and present their personalities as I experience them.\"  Opening reception May 13 at 6:30 p.m. ',4,'2011-06-14 15:52:02','2011-06-14 15:52:02','http://www.villagevoice.com/events/jenny-morgan-one-and-the-many-2559185/','http://vvoice.vo.llnwd.net/e14//6304188.47.jpg','',127,'event_images/4ccd9c301fd8f2ee867c59e9966a31e5c75b13ba_3.jpg',1,0),
