	(372,'http://www.villagevoice.com/events/make-music-new-york-2622535/','Make Music New York','make-music-new-york','New York City\'s about to get a little bit louder with its fifth annual  Make Music New York  celebration. Spanning all five boroughs with more than a thousand concerts featuring genres from classical to unclassified, it\'s hard not to find something to loveor at least dance to. MMNY also features a plethora of special programs, including the Hungry Marching Band\'s jazzy melodies on the newly opened section of the High Line\'s Tenth Avenue Overlook, and a \"sing-it-yourself\" rendition of both Mozart\'s  Coronation Mass  and selections from Handel\'s  Messiah  in Gansevoort Plaza. (Don\'t worry: Sheet music is free on the event\'s website.) Also keep an eye out, starting June 18, for the joyous return of the brightly painted pianos, which dotted the city last summer. If brass or classical doesn\'t fit your fancy, put on your checkered tie and catch the ferry two days earlier for MMNY\'s Punk Island, a chance to watch more than 50 punk bands (among them Common Enemy and Wombat in Combat) play on eight stages across Governors Island.',4,'2011-06-14 15:52:05','2011-06-14 15:52:05','http://www.villagevoice.com/events/make-music-new-york-2622535/','http://vvoice.vo.llnwd.net/e14//6533735.47.jpg','',137,'event_images/65797aedfc56d4e57173c7ffb7e57de1ab765d6e_1.jpg',1,0),
