	(412,'http://www.villagevoice.com/events/philippe-petit-2622374/','Philippe Petit','philippe-petit','It takes balls to walk across a high wire strung together by the city\'s two largest buildings. And  Philippe Petit , the man who accomplished this crazy feat in 1974, as was beautifully documented in the 2008 film  Man on Wire , knows a thing or two about balls. Besides being the world\'s most famous artistic trespasser, he has been arrested more than 500 times for the abomination of abominations: street juggling. Petit has a few other skills as well, including lock-picker, magician, bullfighter, chess player, and now, man of the theater. For three nights, he shares some tricks and some stories in his one-man show,  Wireless! .',4,'2011-06-14 15:52:10','2011-06-14 15:52:10','http://www.villagevoice.com/events/philippe-petit-2622374/','http://vvoice.vo.llnwd.net/e14//6533525.47.jpg','',28,'event_images/a4f3149cc282332bf0aad1765ae60dde85d71aa0_1.jpg',1,0),
	(413,'http://www.villagevoice.com/events/chris-dingman-sextet-2617493/','Chris Dingman Sextet','chris-dingman-sextet','If you believe that ballads deserve the same taut interplay as uptempo tunes, you\'re likely down with vibraphonist Dingman, whose new  Waking Dreams  is a suite of reflections that rebuffs somnambulance with inventive exchange after inventive exchange. Dingman\'s sextet features red-hot trumpeter Ambrose Akinmusire, who loves him some tension and release, but the real hero may be drummer Justin Brown. He never stops strategizing ways to turn a floating suggestion into a charging statement.',4,'2011-06-14 15:52:10','2011-06-14 15:52:10','http://www.villagevoice.com/events/chris-dingman-sextet-2617493/','http://vvoice.vo.llnwd.net/e14//6533375.47.jpg','',137,'event_images/bf80c00317cc1dd0bb68b4c69416e8d1cb6835e3_1.jpg',1,1),
