	(507,'http://www.villagevoice.com/events/the-s-files-2011-2609913/','The (S) Files 2011','the-s-files-2011','El Museo del Barrio\'s sixth biennial  The (S) Files 2011  (the \"S\" stands for street) is so huge this year that there simply isn\'t any room left in the museum to hold it all. The show, their largest biennial to date with modern and innovative works created by 75 Latino, Caribbean, and Latin American artists currently based in the greater New York area, will instead take place in seven different venues, from Times Square to Brooklyn. It will all be broken down by medium with the main emphasis being street artfor instance, the Northern Manhattan Arts Alliance will present large-scale works made of materials found in urban landscapes, while in midtown, temporary outdoor sculptures and installations will be interactive.',4,'2011-06-14 15:52:22','2011-06-14 15:52:22','http://www.villagevoice.com/events/the-s-files-2011-2609913/','http://vvoice.vo.llnwd.net/e14//6461116.47.jpg','',127,'event_images/bd0086bd1bcce14fc76f8288cd2785543c7afab9_1.jpg',1,0),
