	(837,'http://www.villagevoice.com/events/shakespeare-in-the-park-2588251/','Shakespeare in the Park','shakespeare-in-the-park','And so it begins-the summertime ritual of strategizing your way into scoring a free ticket to the Public Theater\'s super-popular  Shakespeare in the Park . This year, you have your pick of two comedies running in repertory:  Measure for Measure  and the delightful  All\'s Well That Ends Well , with a company that includes Carson Elrod, John Cullum, and Tonya Pinkins. There are two ways to get your free tickets: the old-fashioned approach of standing in line at the Delacorte Theater in Central Park (two tickets per person are distributed at 1 p.m. for that evening\'s show) or hopping in the virtual line by logging on to shakespeareinthepark.org (between midnight and 1 p.m. on the day of the performance) and registering your name in the lottery (after 1 p.m., you can log in to learn whether you were lucky enough to win seats for that night). Wearing a lucky rabbit\'s foot is also highly recommended.',4,'2011-06-14 15:53:06','2011-06-14 15:53:06','http://www.villagevoice.com/events/shakespeare-in-the-park-2588251/','http://vvoice.vo.llnwd.net/e14//6413082.47.jpg','',125,'event_images/082b99e1d5bb7add74afbd11a7a39227cb9e6794_1.jpg',1,0),
