	(886,'http://www.villagevoice.com/events/blue-note-jazz-festival-2597705/','Blue Note Jazz Festival','blue-note-jazz-festival','A great jazz song leads with the attack, either rhythmically or evocativelyand the inaugural  Blue Note Jazz Festival  has certainly adopted the same strategy, because their first endeavor is awe-inspiring. Spread over the entire month of June, at many of the best venues in town (including Highline Ballroom, B.B. King Blues Club, Mercury Lounge, and the venerable Blue Note club itself), the roster boasts jazz greats Dave Holland, Hiromi, Bobby McFerrin, Roberta Flack, and even a few pop-leaning luminaries (Brian Wilson! Questlove! Wait . . .  Brian Wilson! ). To resist this for a week, let alone all month, would be insane.',4,'2011-06-14 15:53:12','2011-06-14 15:53:12','http://www.villagevoice.com/events/blue-note-jazz-festival-2597705/','http://vvoice.vo.llnwd.net/e14//6413003.47.jpg','',137,'event_images/9e210e4a5983cc53c39df22b18f6910f45a15ee4_1.jpg',1,0),
