	(982,'http://www.villagevoice.com/events/deervana-2622384/','Deervana','deervana','Established groups masquerading as cover bands? Isn\'t that already called Guns N\' Roses? Deer Tick do their best to bring the acidic grunge levity back to cover shows with  Deervana , the band\'s full-on Nirvana tribute act that debuted to raves at this year\'s SXSW fest and performs tonight as part of the Northside Festival. No strangers to costumed mimicry (the band has also been trussed upor down, ratheras the Sex Pistols), these already feedback-friendly indie folkers will likely do \"Scentless Apprentice\" and \"In Bloom\" proudor just loud. Kurt is smiling somewhere, just because this is so ludicrous. So, too, should you be.',4,'2011-06-14 15:53:25','2011-06-14 15:53:25','http://www.villagevoice.com/events/deervana-2622384/','http://vvoice.vo.llnwd.net/e14//6533542.47.jpg','',137,'event_images/7ebb40a015961f4785b42a56e60b27732bff4f00_1.jpg',1,0),
