	(992,'http://www.villagevoice.com/events/ice-factory-2011-2612985/','Ice Factory 2011','ice-factory-2011','It was certainly troubling to see the Ohio Theatre, run by Soho Think Tank, lose its longtime home on Wooster Street last summer when the building was sold. After all, as STT artistic director Robert Lyons told Playbill magazine, the Ohio was \"where Tony Kushner produced his first play out of college, where Philip Seymour Hoffman made his professional acting debut.\" Happily, the theater has a new temporary residence at 3LD Art and Technology Center under the name Ohio Interrupted@3LD. Which means that STT\'s Obie-winning  Ice Factory Festival  of six New York premieres is back! It kicks off tonight with Robert Saietta\'s  Struck  (runs June 22 through 25), a play, based on a true story, about rock musician Beth Prosser, who gained musical talent (and a serious neurological condition) after being struck by lightning at the age of 18. Up next on the schedule is a play you can literally sink your teeth into:  The Pig, or Vclav Havel\'s Hunt for a Pig  (June 29 through July 2), which invites the audience to \"come hungry\" for a feast of pulled pork, Czech beer, and live music.',4,'2011-06-14 15:53:27','2011-06-14 15:53:27','http://www.villagevoice.com/events/ice-factory-2011-2612985/','http://vvoice.vo.llnwd.net/e14//6533756.47.jpg','',125,'event_images/3ceb86591f0b76aca7c21166d2833223fa19172b_1.jpg',1,0),
