	(1020,'http://www.villagevoice.com/events/snapshot-proud-as-fck-2011-2624056/','*snapshot* Proud As F*ck 2011','snapshot-proud-as-fck-2011','Even though the we said goodbye to the weekly party earlier this year, Snapshot\'s smash-hit Pride extravaganza thankfully returns for it\'s seventh year to Bar 13, spitting distance from the parade route. This year\'s theme is \"Pride for the People,\" fostering a \"much more socialistic\" come-one-come-all atmosphere than other post-parade parties, says promoter Shana Fried. As always, a slew of DJs heat up two dance floors, while Chef Josie ( Top Chef ) provides rooftop grub.',4,'2011-06-14 15:53:30','2011-06-14 15:53:30','http://www.villagevoice.com/events/snapshot-proud-as-fck-2011-2624056/','http://vvoice.vo.llnwd.net/e14//6541981.47.jpg','',169,'event_images/c921e0c327c811ee741ba91bf1051baa63a118fb_1.jpg',1,0),
