	(1043,'http://www.villagevoice.com/events/gen-arts-film-festival-2597731/','Gen Arts Film Festival','gen-arts-film-festival','Wait a secdidn\'t Gen Art file for bankruptcy? Yes, it did. But now, a year later, the experimental arts and entertainment group is back and ready to relaunch with the return of its week-long  Gen Arts Film Festival , seven nights of films by emerging filmmakers, fabulous after-parties, and excellent celebrity spotting at venues all over town. The 16th annual festival kicks off tonight at the Ziegfeld with the debut film by 35-year-old director Jonathan Sobol,  A Beginner\'s Guide to Endings , a comedy about three brothers whose father (Harvey Keitel) informs them they only have a few days left to live due to an unsafe drug test he exposed them to as children for money. Other films include Victoria Mahoneys  Yelling to the Sky , J.C. Khourys  The Pill , and Matt DElias  American Animal .',4,'2011-06-14 15:53:33','2011-06-14 15:53:33','http://www.villagevoice.com/events/gen-arts-film-festival-2597731/','http://vvoice.vo.llnwd.net/e14//6413095.47.jpg','',29,'event_images/85a66343037c61e811eac862502fd89f8b8239be.jpg',1,0),
