	(1085,'http://www.villagevoice.com/events/shat-ball-3-2622364/','Shat Ball 3','shat-ball-3','Attention Star Base: The USS Enterprise will be touching down in Brooklyn to honor Captain Kirk himself, William Shatner, at the  Shat Ball 3 . Though known in more recent memory as Denny Crane from  Boston Legal  or the pudgy, exuberant spokesman over at Priceline.com who likely convinced you to buy an overpriced plane ticket to Cozumel, William Shatner is a bona fide legend in the entertainment industry, and we only have to look to  T.J. Hooker  to prove it to us. The Bell House in Park Slope pays tribute to this titan of Trek with Star Trekthemed comedy, live music, and trivia. Prizes will be awarded to the best Kirk and Spock impersonators; drink specials include Romulan Ale and Klingon blood-wine (delicious). Live long and prosper!',4,'2011-06-14 15:53:39','2011-06-14 15:53:39','http://www.villagevoice.com/events/shat-ball-3-2622364/','http://vvoice.vo.llnwd.net/e14//6533491.47.jpg','',16,'event_images/d31541aadd6acd170f645bb06d78c1b69ee802af.jpg',1,6),
