	(1146,'http://www.villagevoice.com/events/west-side-story-891841/','West Side Story','west-side-story','I like it here in America, sings a character in this Arthur Laurents/ Leonard Bernstein/Stephen Sondheim musical. And America likes you, toothats the hope of 91-year-old Laurents who directs this Broadway revival. This version emphasizes the shows multiculturalism, with many of the Sharkss songs translated into Spanish.',4,'2011-06-14 15:53:47','2011-06-14 15:53:47','http://www.villagevoice.com/events/west-side-story-891841/','http://vvoice.vo.llnwd.net/e14//3044504.47.jpg','',124,'event_images/2f124e1329c49d1eda20d64e23e9a5efea7b1ba8_1.jpg',1,0),
