	(1148,'http://www.villagevoice.com/events/best-coast-2609911/','Best Coast','best-coast','The Celebrate Brooklyn festival revs its engines for yet another summer season with a worthy act: Los Angeles garage-poppers  Best Coast , whose swell-heavy scraps of surf-rock distortion will sound beautifully resonant against the Brooklyn sunset. Singer Bethany Cosentino, drummer Ali Koehler (formerly of Vivian Girls), and producer/multi-instrumentalist Bobb Bruno are playing in support of last year\'s debut  Crazy for You  and this year\'s  Summer Is Forever , their split seven-inch with Wavves, both lovingly lo-fi and terrifically catchy. With some escaped librarians called the Decemberists.',4,'2011-06-14 15:53:47','2011-06-14 15:53:47','http://www.villagevoice.com/events/best-coast-2609911/','http://vvoice.vo.llnwd.net/e14//6461022.47.jpg','',137,'event_images/d33d95d1c618a6878eaf4a5f78fe206c15061d9f.jpg',1,0),
