	(1195,'http://www.villagevoice.com/events/american-idiot-1707430/','American Idiot','american-idiot','Between \"Lust for Life\" \'s revival as a Carnival Cruise jingle and the agonizing walk past the John Varvatos store where CBGB\'s used to be, it\'s no secret that punk-rock culture has seen some ugly lows. Green Day\'s Broadway musical  American Idiot , however, may just carve out a mosh pit for itself among these contenders. Tony-winning director Michael Mayer ( Spring Awakening ) is behind this venture, which features songs from the  American Idiot  and  21st Century Breakdown  albums. The show premiered at the Berkeley Rep and earned a range of decent to glowing reviews. From what we can tell, expect lots of heavily stylized thrashing and sets that make for a candy-colored faux-boho vibe not wholly unlike  Rent . John Gallagher Jr., who won a Tony for his role in  Spring Awakening , stars as the jaded suburbanite slacker Johnny.',4,'2011-06-14 15:53:54','2011-06-14 15:53:54','http://www.villagevoice.com/events/american-idiot-1707430/','http://vvoice.vo.llnwd.net/e14//4553433.47.jpg','',124,'event_images/c0603abd5a5015d21396c01738b7690510ee04cd_1.jpg',1,0),
	(1196,'http://www.villagevoice.com/events/northside-festival-frankie-rose-brilliant-colors-sherlocks-daughter-2621205/','\'Northside Festival: Frankie Rose+Brilliant Colors+Sherlock\'s Daughter\'','northside-festival-frankie-rosebrilliant-colorsshe','',4,'2011-06-14 15:53:54','2011-06-14 15:53:54','http://www.villagevoice.com/events/northside-festival-frankie-rose-brilliant-colors-sherlocks-daughter-2621205/','','',137,'',1,1),
	(1197,'http://www.villagevoice.com/events/pierpont-morgans-1906-library-2516895/','Pierpont Morgan\'s 1906 Library','pierpont-morgans-1906-library','In 2010 the Morgan restored the interior of the 1906 library to its original grandeur. A new lighting system was installed to illuminate the extraordinary murals and decor of the four historic rooms.',4,'2011-06-14 15:53:54','2011-06-14 15:53:54','http://www.villagevoice.com/events/pierpont-morgans-1906-library-2516895/','','',121,'',1,0),
	(1198,'http://www.villagevoice.com/events/the-shaggs-philosophy-of-the-world-2559038/','The Shaggs: Philosophy of the World','the-shaggs-philosophy-of-the-world','The bittersweet story of the Shaggs begins with a strict, delusional father who dreamed that his three talentless daughters could be the next big rock band. They, of course, never made it outside their small New Hampshire town. Instead, Helen, Betty, and Dorothy Wiggin performed childish, tone-deaf ditties, such as \"Who Are Parents?\" and \"My Pal Foot Foot,\" and went on to record only one album in 1969 titled  Philosophy of the World  before disbanding in 1975 upon their father\'s sudden death. No one could have guessed that a little more than a decade later, Lester Bangs, in a 1981  Voice  piece on the Shaggs titled \"Better Than the Beatles (and DNA, Too),\" (a play on Shaggs fan Frank Zappa\'s  declaration in  Playboy  in 1976 that the trio were \"better than the Beatles\") would proclaim their album to be \"one of the landmarks of roll \'n\' roll history.\" The sisters have since gained a cult following with fans all over the world, and their fame continues to grow with this new play  The Shaggs: Philosophy of the World , a co-production by Playwrights Horizons and New York Theatre Workshop. John Langs directs a cast including Annie Golden, Steve Routman, Sarah Sokolovic, and Emily Walton. Joy Gregory and Gunnar Madsen provide the lyrics. Earplugs not provided.',4,'2011-06-14 15:53:54','2011-06-14 15:53:54','http://www.villagevoice.com/events/the-shaggs-philosophy-of-the-world-2559038/','http://vvoice.vo.llnwd.net/e14//6323081.47.jpg','',125,'event_images/ae327841abfc8d7c6ad3e8eaaaef84704c8e6a22_1.jpg',1,0),
