	(1266,'http://www.villagevoice.com/events/iceage-2622370/','Iceage','iceage','Copenhagen\'s  Iceage  have yet to play stateside, but their reputation for unhinged, chaotic live shows precedes them, thanks in part to their meticulously maintained blog, where they post bloody photos of various band members, post-performance. No one in this quartet is older than 20, which means they\'re far too young to have seen any of the Gravity Recordsstyle post-hardcore bands their sound most resembles, but the facsimile can be eeriecertainly no act in this country is carrying on the legacy of the bygone, alternately melodic, and dissonant San Diego punk scene more faithfully. This Friday, they play their hotly anticipated New York debut as part of the L Magazine\'s Northside Festival, alongside the local one-man wrecking crew that is Dominick Fernow\'s Prurientfitting, as Fernow\'s moody, melodic work with his other band, Cold Cave, surely helped inspire Iceage\'s similarly darkwave sound.',4,'2011-06-14 15:54:04','2011-06-14 15:54:04','http://www.villagevoice.com/events/iceage-2622370/','http://vvoice.vo.llnwd.net/e14//6533521.47.jpg','',137,'event_images/e8a6d56c5ae94c49597d2800ccee9ca8da021825.jpg',1,1),
