	(1327,'http://www.villagevoice.com/events/2-2-4-2608621/','2+2=4','224','Work by Steve Currie, George Kroenert, Gelah Penn, and Susanna Starr.',4,'2011-06-14 15:54:12','2011-06-14 15:54:12','http://www.villagevoice.com/events/2-2-4-2608621/','','',171,'',1,0),
